['&#60;p&#62;CALL +MAIL\xa0&#60;/p&#62;', '&#60;p&#62;&#60;a href="https://community.adobe.com/t5/acrobat-discussions/outlook-won-t-preview-pdf-files/td-p/12134674"&#62;Résolu\xa0: Outlook won't preview PDF files - Adobe Community - 12134674&#60;/a&#62;&#60;/p&#62;
&#60;p&#62;\xa0&#60;/p&#62;
&#60;p&#62;tester cette méthode :\xa0&#60;/p&#62;
&#60;p&#62;Please try to turn off the Acrobat protected mode for testing (Windows Only). Go to Edit &#38;gt; Preferences &#38;gt; Enhanced\xa0Security &#38;gt; Uncheck 'Enable Protected mode at startup' Turn off the protected mode and uncheck 'Enhanced Security' &#38;gt; Click OK and reboot the computer once.&#60;/p&#62;
