&#60;p&#62;- décocher, cocher les cases previewer&#60;/p&#62;
&#60;p&#62;- vérification des préferences sur adobe tout est ok&#60;/p&#62;
&#60;p&#62;- désinstallé Reader, puis installé à nouveau\xa0&#60;/p&#62;
&#60;p&#62;outlook est en 64 bits et adobe en 32 bits\xa0 \xa0je me demande s'il y a pas un problème d'incompatibilité\xa0&#60;/p&#62;
&#60;p&#62;\xa0&#60;/p&#62;
