['&#60;p&#62;Mail&#60;/p&#62;', '&#60;p&#62;0793189993&#60;/p&#62;', '&#60;p&#62;Seen with TANS.&#60;/p&#62;
&#60;p&#62;Naming convention : dl_City&#60;/p&#62;
&#60;p&#62;&#60;strong&#62;Cannot be created from ExchangeOnline UI&#60;/strong&#62;&#60;/p&#62;
&#60;p&#62;To create the dynmaicDistributionGroup via Powershell :&#60;/p&#62;
&#60;p&#62;Connect-ExchangeOnline&#60;/p&#62;
&#60;p&#62;New-DynamicDistributionGroup -Name "dl_Lausanne" -RecipientContainer "taurushq.com" -RecipientFilter {RecipientType -eq “UserMailbox” -and City -eq "Lausanne"}&#60;/p&#62;
&#60;p&#62;\xa0&#60;/p&#62;
&#60;p&#62;Do not execute that command before validation.&#60;/p&#62;
&#60;p&#62;To retrieve all the members from the ddl :&#60;/p&#62;
&#60;p&#62;&#60;strong&#62;Connect-ExchangeOnline&#60;/strong&#62;&#60;/p&#62;
&#60;p&#62;&#60;strong&#62;Connect-AzureAD (Or Graph)&#60;/strong&#62;&#60;/p&#62;
&#60;p&#62;$users = Get-DynamicDistributionGroupMember -Identity "dl_Lausanne).Name&#60;/p&#62;
&#60;p&#62;foreach($user in $users){&#60;/p&#62;
&#60;p&#62;Get-AzureADuser -ObjectID $user&#60;/p&#62;
&#60;p&#62;}&#60;/p&#62;
&#60;p&#62;\xa0&#60;/p&#62;
&#60;p&#62;For testing :&#60;/p&#62;
&#60;p&#62;Add the requester in the condition Alias -eq "Johan" for example&#60;/p&#62;
&#60;p&#62;Do a test with the requester first. After validation, remove that optional condition.&#60;/p&#62;
&#60;p&#62;\xa0&#60;/p&#62;', '&#60;p&#62;In Exchange for the conditions, we don't have "City" as condition field.&#60;/p&#62;
&#60;p&#62;The only field visible is "State or Province"&#60;/p&#62;
&#60;p&#62;Is it possible to reflect City on State or Province.&#60;/p&#62;
&#60;p&#62;\xa0&#60;/p&#62;
&#60;p&#62;UPDATE :&#60;/p&#62;
&#60;p&#62;Can be done with powershell. Did the test working good&#60;/p&#62;']

