&#60;p&#62;J'ai contacté Claudia,&#60;/p&#62;
&#60;p class="MsoNormal"&#62;J’ai pris la main sur son PC pour diagnostiquer son problème d’impression.&#60;/p&#62;
&#60;p class="MsoNormal"&#62;Elle m'explique qu'elle arrive à imprimer qu'à partir du bac du 1er Bac (du haut).&#60;/p&#62;
&#60;p class="MsoNormal"&#62;Elle avait hier un message d’erreur concernant le format papier.&#60;/p&#62;
&#60;p class="MsoNormal"&#62;Pour infos: deux personnes utilisent cette imprimante et les deux ont le même problème.&#60;/p&#62;
&#60;p class="MsoNormal"&#62;Je cible donc un diagnostique orienté vers l'imprimante.&#60;/p&#62;
&#60;p class="MsoNormal"&#62;Je me connecte à l'interface graphique de l'imprimante:&#60;/p&#62;
&#60;p class="MsoNormal"&#62;il s'agit d'une HP Color LaserJet Pro MFP M479fdw&#60;/p&#62;
&#60;p class="MsoNormal"&#62;Je fais un redémarrage depuis l'interface d'administration.&#60;/p&#62;
&#60;p class="MsoNormal"&#62;dans les propriétés d'impression le choix du bac est sur "auto".&#60;/p&#62;
&#60;p class="MsoNormal"&#62;Solution de contournement je force le choix au bas du bas.&#60;/p&#62;
&#60;p class="MsoNormal"&#62;la solution fonctionne.&#60;/p&#62;

