['&#60;p&#62;mail\xa0&#60;/p&#62;', '&#60;p&#62;call + mail\xa0&#60;/p&#62;', "&#60;p&#62;on à désactivé\xa0 defender puis\xa0 redémarré\xa0 puis transférer des fichiers il y a eu un crash.&#60;br&#62;&#60;br&#62;Après le démarrage defender était actif,\xa0 on à transférer des ficher de petit taille puis augmenté la taille des fichiers au fut et à mesure&#60;/p&#62;
&#60;p&#62;Il n'y pas eu de crash en utilisant cette méthode\xa0&#60;/p&#62;
&#60;p&#62;\xa0&#60;/p&#62;
&#60;p&#62;Total\xa0 2h\xa0&#60;/p&#62;", "&#60;p&#62;Les petits fichiers, on arrive à les transférer.&#60;/p&#62;
&#60;p&#62;\xa0&#60;/p&#62;
&#60;p&#62;Le PDF à 5Mb ,Le PC crash. Obligé de redemarrer car le pc freeze. Un reboot est obligatoire. Côté event viewer, rien de relevant.&#60;/p&#62;
&#60;p&#62;\xa0&#60;/p&#62;
&#60;p&#62;On va effectuer quelques tests. La mise à jour de sécurité, on peut pas la retirer comme ça.&#60;/p&#62;
&#60;p&#62;\xa0&#60;/p&#62;
&#60;ul&#62;
&#60;li&#62;Possible de transférer des petits fichiers (On va tester plusieurs tailles)&#60;/li&#62;
&#60;li&#62;On a desactivé defender - Le fichier léger a pu être transéféré (A tester en activant le defender)&#60;/li&#62;
&#60;li&#62;Tous les utilisateurs M-Files sont impactés&#60;/li&#62;
&#60;li&#62;C'est possible que la MAJ a rendu quelque chose incompatible avec M-files (.NET)&#60;/li&#62;
&#60;/ul&#62;", '&#60;p&#62;le pc plante toujours malgré la désinstallations des mises à jour lors du transfert de fichiers de m-files vers\xa0 le disque z&#60;/p&#62;
&#60;p&#62;je vais désinstaller la mise à jour du 14/11 aussi\xa0&#60;/p&#62;', '&#60;p&#62;&#60;a href="/glpi/front/document.send.php?docid=80686&#38;itemtype=Ticket&#38;items_id=219663" target="_blank" &#62;&#60;img alt="18371655-b2d8e96f-65561864a181e7.44814360" width="927" src="/glpi/front/document.send.php?docid=80686&#38;itemtype=Ticket&#38;items_id=219663" /&#62;&#60;/a&#62;&#60;/p&#62;', '&#60;p&#62;&#60;a href="https://helpdesk.elca-services.com/glpi/front/document.send.php?docid=80685&#38;amp;itemtype=Ticket&#38;amp;items_id=219663" target="_blank" rel="noopener"&#62;désinstallation\xa0 des 2\xa0 updates windows&#60;/a&#62;&#60;/p&#62;
&#60;p&#62;&#60;a href="https://helpdesk.elca-services.com/glpi/front/document.send.php?docid=80685&#38;amp;itemtype=Ticket&#38;amp;items_id=219663" target="_blank" rel="noopener"&#62;&#60;img src="https://helpdesk.elca-services.com/glpi/front/document.send.php?docid=80685&#38;amp;itemtype=Ticket&#38;amp;items_id=219663" alt="18371655-b2d8e96f-6556171e43d291.16089511" width="1005"&#62;&#60;/a&#62;&#60;/p&#62;', "&#60;p&#62;zeljka et romain buff ont l'incident aussi\xa0&#60;/p&#62;
&#60;p&#62;\xa0&#60;/p&#62;
&#60;p&#62;d'aprés romain l'incendent se produit depuis les mises à jour windows effectuées hier\xa0&#60;/p&#62;
&#60;p&#62;le pc arrête de fonctionner lors de certaines taches\xa0&#60;/p&#62;
