&#60;p&#62;&#60;span style="font-family: , 'blinkmacsystemfont' , 'segoe ui' , 'roboto' , 'oxygen' , 'ubuntu' , 'fira sans' , 'droid sans' , 'helvetica neue' , sans-serif; text-align: left;"&#62;Kathia s'occupe de la com sur ce sujet&#60;/span&#62;&#60;/p&#62;', '&lt;p&gt;Aucun printer Kodak sur notre print server.&lt;/p&gt;&lt;p&gt;&lt;a href="https://helpdesk.elca-services.com/glpi/front/document.send.php?docid=71459&amp;tickets_id=200870" target="_blank" rel="noopener"&gt;&lt;img src="https://helpdesk.elca-services.com/glpi/front/document.send.php?docid=71459&amp;tickets_id=200870" alt="27ef38ca-f37490bd-646e17a3588f76.65946453" width="127.15641025641027" /&gt;&lt;/a&gt;&lt;/p&gt;&lt;p&gt;Il nous faudrait au moins l'adresse IP pour poursuivre la config &lt;span lang="FR-CH" style="font-size: 10.0pt;"&gt;du Kodak 730 EX&lt;/span&gt;&lt;/p&gt;', '&lt;p&gt;Configure scan to mail :&lt;/p&gt;&lt;p&gt;\xa0&lt;/p&gt;&lt;p&gt;-Fixe DNS&lt;/p&gt;&lt;p&gt;-Compte courrier ged@aphm-cc514.ch&lt;/p&gt;&lt;p&gt;\xa0&lt;/p&gt;&lt;p&gt;&lt;span lang="FR-CH" style="font-size: 10.0pt;"&gt;192.168.214.53&lt;/span&gt; OK :&lt;/p&gt;&lt;p&gt;&lt;a href="https://helpdesk.elca-services.com/glpi/front/document.send.php?docid=71455&amp;tickets_id=200870" target="_blank" rel="noopener"&gt;&lt;img src="https://helpdesk.elca-services.com/glpi/front/document.send.php?docid=71455&amp;tickets_id=200870" alt="27ef38ca-f37490bd-646e16f1b86bb0.88583051" width="551" /&gt;&lt;/a&gt;&lt;/p&gt;&lt;p&gt;192.168.214.55 OK :&lt;/p&gt;&lt;p&gt;&lt;a href="https://helpdesk.elca-services.com/glpi/front/document.send.php?docid=71454&amp;tickets_id=200870" target="_blank" rel="noopener"&gt;&lt;img src="https://helpdesk.elca-services.com/glpi/front/document.send.php?docid=71454&amp;tickets_id=200870" alt="27ef38ca-f37490bd-646e16ce8b3826.23755879" width="551" /&gt;&lt;/a&gt;&lt;/p&gt;&lt;p&gt;\xa0&lt;/p&gt;&lt;p&gt;Réponse faite dans Ticket 194896&lt;/p&gt;', '&lt;p&gt;Duplcate of https://helpdesk.elca-servic